DROP TABLE IF EXISTS `warehouse_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `warehouse_product` (
  `LotNumberBatch` varchar(100) DEFAULT NULL COMMENT '批次',
  `LotNumber` varchar(100) DEFAULT NULL COMMENT '批號',
  `CompId` varchar(45) NOT NULL COMMENT '品項所屬的組織ID',
  `ManufacturerId` varchar(100) DEFAULT NULL COMMENT '品項所屬的製造商ID',
  `ManufacturerName` varchar(100) DEFAULT NULL COMMENT '品項所屬的製造商名稱',
  `DeadlineRule` int DEFAULT NULL COMMENT '有效期限規範',
  `DeliverRemarks` varchar(500) DEFAULT NULL COMMENT '運送備註',
  `GroupIds` varchar(2000) DEFAULT NULL COMMENT '屬於數個組別',
  `GroupNames` varchar(2000) DEFAULT NULL COMMENT '組別名稱',
  `InStockQuantity` int DEFAULT '0' COMMENT '庫存數量',
  `Manager` varchar(45) DEFAULT NULL COMMENT '管理者',
  `MaxSafeQuantity` int DEFAULT NULL COMMENT '最高安庫量',
  `LastAbleDate` date DEFAULT NULL COMMENT '最後可使用日期',
  `LastOutStockDate` date DEFAULT NULL COMMENT '最後出庫日期',
  `OpenDeadline` int DEFAULT NULL COMMENT '開封有效期限\n數字（開封後可以用幾天），檢查資料庫是不是int',
  `OpenedSealName` varchar(100) DEFAULT NULL COMMENT '開封列印名稱',
  `OriginalDeadline` date DEFAULT NULL COMMENT '原始有效期限',
  `PackageWay` varchar(100) DEFAULT NULL COMMENT '包裝方式',
  `PreDeadline` int DEFAULT NULL COMMENT '已入庫未使用，當前日期在末效日期前幾天通知用',
  `PreOrderDays` int DEFAULT NULL COMMENT '前置天數',
  `ProductCategory` varchar(100) DEFAULT NULL COMMENT '產品類別\n[耗材, 試劑, 其他]',
  `ProductCode` varchar(200) DEFAULT NULL COMMENT '產品編碼',
  `ProductId` varchar(100) NOT NULL,
  `ProductModel` varchar(200) DEFAULT NULL COMMENT '品項型號',
  `ProductName` varchar(200) DEFAULT NULL COMMENT '品項名稱',
  `ProductRemarks` varchar(300) DEFAULT NULL COMMENT '品項備註',
  `ProductSpec` varchar(300) DEFAULT NULL COMMENT '品項規格',
  `SafeQuantity` int DEFAULT NULL COMMENT '最小安庫量',
  `UDIBatchCode` varchar(300) DEFAULT NULL COMMENT 'UDI 碼',
  `UDICreateCode` varchar(300) DEFAULT NULL COMMENT 'UDI 碼',
  `UDISerialCode` varchar(300) DEFAULT NULL COMMENT 'UDI 碼',
  `UDIVerifyDateCode` varchar(300) DEFAULT NULL COMMENT 'UDI 碼',
  `Unit` varchar(100) DEFAULT NULL COMMENT '單位',
  `Weight` varchar(100) DEFAULT NULL COMMENT '重量',
  `ProductMachine` varchar(200) DEFAULT NULL COMMENT '品項所屬儀器',
  `DefaultSupplierID` int DEFAULT NULL COMMENT '預設供應商',
  `DefaultSupplierName` varchar(200) DEFAULT NULL COMMENT '預設供應商名稱',
  `IsNeedAcceptProcess` tinyint(1) DEFAULT '0' COMMENT '該品項出庫時，是否需要經過二次驗收',
  `AllowReceiveDateRange` int DEFAULT NULL COMMENT '該品項期限距離現在的最小天數',
  `CreatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `UpdatedAt` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `UnitConversion` int DEFAULT '1' COMMENT '用來在訂購時將最小單位轉為訂購規格及驗收時 將訂購規格轉為最小單位數量用的欄位',
  `TestCount` int DEFAULT '1' COMMENT '在總覽表與目前庫存數量(InStockQuantity)相乘顯示給使用者知道目前可用的數量用的欄位',
  `IsActive` tinyint(1) DEFAULT '1',
  `StockLocation` varchar(200) DEFAULT NULL,
  `Delievery` varchar(200) DEFAULT 'VENDOR' COMMENT 'VENDOR:廠商直寄,\nOWNER:得標廠商(金萬林)供貨',
  `SupplierUnitConvertsion` int DEFAULT '1',
  `SupplierUnit` varchar(100) DEFAULT NULL,
  `DeliverFunction` varchar(45) DEFAULT NULL,
  `DeliverTemperature` double DEFAULT NULL,
  `SavingFunction` varchar(45) DEFAULT NULL,
  `SavingTemperature` double DEFAULT NULL,
  `CompName` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`CompId`,`ProductId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='1. 庫存品項基本資料，因為要考慮到調撥這件事情，也就是從醫院單位A把項目移動部分庫存量到醫院單位B；所以，任一相同品項，在不同的醫院單位內的 ProductID 應該是一制，在這條件下，Product 表格的 PK 應是 CompID + ProductID\n2. 目前最大庫存量與最小安庫量跟庫存數量(InStockQuantity)這個欄位去做判斷就好 不要牽扯到TestCount 這樣感覺比較單純 ，TestCount這個欄位僅用來呈現目前尚存TEST用就好\n3. 用無條件進位的方式去轉換成訂購數量\n例如 單位訂購某品項10組 但UnitCoonversion欄位設定為4 則換算結果10/4=2.5 則無條件進位 意即訂購此品項變為3';
/*!40101 SET character_set_client = @saved_cs_client */;

